<!DOCTYPE html>
<html lang="en">
  <head>
    <meta charset="utf-8">
    <meta http-equiv="X-UA-Compatible" content="IE=edge">
    <meta name="viewport" content="width=device-width,initial-scale=1.0">
    <link rel="icon" href="<%= BASE_URL %>favicon.ico">
    <link href="https://fonts.googleapis.com/css?family=Noto+Sans" rel="stylesheet"> 
    <title>typedoc-spa</title>
  </head>
  <body>
    <noscript>
      <strong>We're sorry but typedoc-spa doesn't work properly without JavaScript enabled. Please enable it to continue.</strong>
    </noscript>

    <script>
    window.$typedoc = {
      modules: [
        { name: "@baklavajs/core", file: "core.json" },
        { name: "@baklavajs/engine", file: "plugin-engine.json" }
      ]
    }
    </script>

    <div id="app"></div>
    <!-- built files will be auto injected -->
  </body>
</html>
